<template>
  <div v-if="paciente" class="paciente-info">

    <CircularPhoto :base64="paciente.photo"/>
    <div class="flex flex-col gap-4">
      <div class="flex flex-col items-center ml-4 gap-1">
        <h3 class="text-xl">Dados Pessoais</h3>
        <div class="border-t h-[2px] w-full rounded-full opacity-30 bg-gray-300"/>

        <div class="grid grid-cols-3 gap-x-5 gap-y-2">

          <div class="info">
            <label class="identificacao">CPF</label>
            <span class="text-sm">{{ paciente.CPF }}</span>
          </div>

          <div class="info">
            <label class="identificacao">CNS</label>
            <span class="text-sm">{{ paciente.CNS }}</span>
          </div>

          <div class="info">
            <label class="identificacao">Dta de Nasc.</label>
            <span class="text-sm">{{ paciente.birthDate }}</span>
          </div>

          <div class="info">
            <label class="identificacao">Nome da Mãe</label>
            <span class="text-sm">{{ paciente.motherName }}</span>
          </div>
        </div>

      </div>

      <div class="flex flex-col items-center ml-4 gap-1">
        <h3 class="text-xl">Endereço</h3>
        <div class="border-t h-[2px] w-full rounded-full opacity-30 bg-gray-300"/>

        <div class="grid grid-cols-3 gap-x-10 gap-y-4">
          <div class="info">
            <label class="identificacao">CEP</label>
            <span class="text-sm">{{ paciente.address.CEP }}</span>
          </div>
          <div class="info">
            <label class="identificacao">Rua</label>
            <span class="text-sm">{{ paciente.address.address }}</span>
          </div>

          <div class="info">
            <label class="identificacao">Numero</label>
            <span class="text-sm">{{ paciente.address.number }}</span>
          </div>

          <div class="info">
            <label class="identificacao">Bairro.</label>
            <span class="text-sm">{{ paciente.address.neighborhood }}</span>
          </div>

          <div class="info">
            <label class="identificacao">Cidade</label>
            <span class="text-sm">{{ paciente.address.city }}</span>
          </div>

          <div class="info">
            <label class="identificacao">Estado</label>
            <span class="text-sm">{{ paciente.address.state }}</span>
          </div>
        </div>

      </div>
    </div>
  </div>

</template>

<script setup>

import {onMounted, ref} from "vue";
import CircularPhoto from "@/components/CircularPhoto.vue";

const base64 = () => {
  return 'data:image/jpeg;base64,'
}

const props = defineProps({
  pacienteId: {
    type: String,
    required: true
  }
})

const paciente = ref(undefined)

onMounted(() => {
  fetch(`api/patients/${props.pacienteId}`)
      .then(res => res.json())
      .then(({status, data}) => {
        if (status !== 200) return;
        paciente.value = data
      })
})

</script>


<style>

.paciente-info {
  @apply flex flex-col items-center w-[500px] gap-6
}

.info {
  @apply flex flex-col items-center
}

.identificacao {
  @apply opacity-60 text-gray-700 text-xs
}
</style>
